import React from 'react';
import './App.scss';

function App() {
  let quote = "Life isn’t about getting and having, it’s about giving and being.";
  let author = "Kevin Kruse";
  return (
    <div className="App">
      <header className="App-header">
        <p>
          {quote}
        </p>
        <p>
          {author}
        </p>
      </header>
    </div>
  );
}

export default App;
